import React, { useEffect } from 'react';

const Logout = () =>{

    useEffect(()=>{
        fetch('/logout', {
        method: "GET",
        headers: {
            Accept: "application/json",                    
            "Content-Type": "application/json" },
            creadentials: "include"

        })
    });

    return(
        <>

        </>
    )
}

export default Logout;
